import React from 'react';
import styled from 'styled-components';

const Report = () => {
    return (
        <Style>
            <h2> Great! Your report is ready... </h2>
        </Style>
    );
}

export default Report;

const Style = styled.div`
    background: #121e33;
    min-height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    color: #cecece;
`
